typedef struct {
  /* Amount of data points */
  int n;

  /* Input: density, gradient, laplacian and kinetic energy density */
  double *rho;
  double *sigma;
  double *lapl;
  double *tau;

  /* Output: energy density */
  double *zk;

  /* .. and potentials for density, gradient, laplacian and tau */
  double *vrho;
  double *vsigma;
  double *vlapl;
  double *vtau;

  /* ... and second derivatives */
  double *v2rho2;
  double *v2tau2;
  double *v2lapl2;
  double *v2rhotau;
  double *v2rholapl;
  double *v2lapltau;
  double *v2sigma2;
  double *v2rhosigma;
  double *v2sigmatau;
  double *v2sigmalapl;

  /* ... and third derivatives */
  double *v3rho3;
  double *v3rho2sigma;
  double *v3rhosigma2;
  double *v3sigma3;


  // The same things but now for CUDA
  /* Input: density, gradient, laplacian and kinetic energy density */
  double *rhoCUDA;
  double *sigmaCUDA;
  double *laplCUDA;
  double *tauCUDA;

  /* Output: energy density */
  double *zkCUDA;

  /* .. and potentials for density, gradient, laplacian and tau */
  double *vrhoCUDA;
  double *vsigmaCUDA;
  double *vlaplCUDA;
  double *vtauCUDA;

  /* ... and second derivatives */
  double *v2rho2CUDA;
  double *v2tau2CUDA;
  double *v2lapl2CUDA;
  double *v2rhotauCUDA;
  double *v2rholaplCUDA;
  double *v2lapltauCUDA;
  double *v2sigma2CUDA;
  double *v2rhosigmaCUDA;
  double *v2sigmatauCUDA;
  double *v2sigmalaplCUDA;

  /* ... and third derivatives */
  double *v3rho3CUDA;
  double *v3rho2sigmaCUDA;
  double *v3rhosigma2CUDA;
  double *v3sigma3CUDA;


} values_t;


