    double *excCUDA = NULL;
    if (exc != NULL) {
	cudaMalloc((void **)&excCUDA, mem_size_for_cuda_arrays);
	cudaMemset(excCUDA, 0, mem_size_for_cuda_arrays);
    }

    double *vrhoCUDA = NULL;
    if (vrho != NULL) {
	cudaMalloc((void **)&vrhoCUDA, mem_size_for_cuda_arrays);
	cudaMemset(vrhoCUDA, 0, mem_size_for_cuda_arrays);
    }
	
    double *vsigmaCUDA = NULL;
    if (vsigma != NULL) {
	cudaMalloc((void **)&vsigmaCUDA, mem_size_for_cuda_arrays);
	cudaMemset(vsigmaCUDA, 0, mem_size_for_cuda_arrays);
    }

    double *v2rho2CUDA = NULL;
    cudaMalloc((void **)&v2rho2CUDA, mem_size_for_cuda_arrays);
    cudaMemset(v2rho2CUDA, 0, mem_size_for_cuda_arrays);

    double *v2rhosigmaCUDA = NULL;
    cudaMalloc((void**)&v2rhosigmaCUDA, mem_size_for_cuda_arrays);
    cudaMemset(v2rhosigmaCUDA, 0, mem_size_for_cuda_arrays);

    double *v2sigma2CUDA = NULL;
    cudaMalloc((void**)&v2sigma2CUDA, mem_size_for_cuda_arrays);
    cudaMemset(v2sigma2CUDA, 0, mem_size_for_cuda_arrays);

    int func_id = functional_id;

    if(xc_func_init(&func, func_id, XC_UNPOLARIZED) != 0){
        fprintf(stderr, "Functional '%d' not found\n", func_id);
        return;
    }

    switch(func.info->family)
    {
    case XC_FAMILY_LDA:
        xc_lda_exc(&func, 5, rho, exc);
        break;
    case XC_FAMILY_GGA:
    case XC_FAMILY_HYB_GGA:
        /*
         * void xc_gga_vxc(const xc_func_type *p,
         * int np, double *rho, double *sigma,
         * double double *vrho, double *vsigma)
         * input:
         * p: structure obtained from calling xc_func_init
         * np: number of points
         * rho[]: the density
         * sigma[]: contracted gradients of the density
         * output:
         * exc[]: the energy per unit particle
         * vrho[]: first partial derivative of the energy per
         *          unit volume in terms of the density
         * vsigma[]: first partial derivative of the energy per
         *          unit volume in terms of sigma
         * v2rho2[]: second partial derivative of the energy per
         *          unit volume in terms of the density
         * v2rhosigma[]: second partial derivative of the energy per
         *          unit volume in terms of the density and sigma
         * v2sigma2[]: second partial derivative of the energy per
         *          unit volume in terms of sigma
         */
	xc_gga(&func, 5, rhoCUDA, sigmaCUDA, excCUDA, vrhoCUDA, vsigmaCUDA, 
	    v2rho2CUDA, v2rhosigmaCUDA, v2sigma2CUDA, NULL, NULL, NULL, NULL);
        break;
    }

    // Copiamos de vuelta lo que dejo en los arrays.
    cudaMemcpy(&exc, excCUDA, mem_size_for_cuda_arrays, cudaMemcpyDeviceToHost);
    cudaMemcpy(&rho, rhoCUDA, mem_size_for_cuda_arrays, cudaMemcpyDeviceToHost);
    cudaMemcpy(&vrho, vrhoCUDA, mem_size_for_cuda_arrays, cudaMemcpyDeviceToHost);
    cudaMemcpy(&vsigma, vsigmaCUDA, mem_size_for_cuda_arrays, cudaMemcpyDeviceToHost);

    for(int i=0; i<5; i+=1){
        printf("%lf %lf %lf %lf \n", rho[i], exc[i], vrho[i], vsigma[i]);
    }

    xc_func_end(&func);
    /*
    The output of the above example should
    look something like this:

    Libxc version: 4.0.0
    0.100000 -0.342809
    0.200000 -0.431912
    0.300000 -0.494416
    0.400000 -0.544175
    0.500000 -0.586194
    */

    // Free the memory
    cudaFree(excCUDA);
    cudaFree(rhoCUDA);
    cudaFree(vrhoCUDA);
    cudaFree(vsigmaCUDA);
    cudaFree(v2rho2CUDA);
    cudaFree(v2rhosigmaCUDA);
    cudaFree(v2sigma2CUDA);

}

